import React, { useState } from "react";
import { Link } from "react-router-dom";
import Cookies from "js-cookie"; // if you're using cookies

const Menu = () => {
  const [selectedMenu, setSelectedMenu] = useState(0);
  const [isProfileDropdownOpen, setIsProfileDropdownOpen] = useState(false);

  const handleMenuClick = (index) => {
    setSelectedMenu(index);
  };

  const handleProfileClick = () => {
    setIsProfileDropdownOpen(!isProfileDropdownOpen);
  };

  const menuClass = "menu";
  const activeMenuClass = "menu selected";

  // ðŸ”’ Logout logic
  const handleLogout = () => {
    // Clear localStorage or cookies
    localStorage.removeItem("token");
    Cookies.remove("token"); // Only if you're using js-cookie
    // Redirect to login/home page
    window.location.href = "/";
  };

  // ðŸ”™ Go to frontend
  const goToFrontend = () => {
    window.location.href = "http://localhost:3002"; 
  };

  return (
    <div className="menu-container">
      <img src="logo.png" style={{ width: "50px" }} />
      <div className="menus">
        <ul>
          <li>
            <Link style={{ textDecoration: "none" }} to="/" onClick={() => handleMenuClick(0)}>
              <p className={selectedMenu === 0 ? activeMenuClass : menuClass}>Dashboard</p>
            </Link>
          </li>
          <li>
            <Link style={{ textDecoration: "none" }} to="/orders" onClick={() => handleMenuClick(1)}>
              <p className={selectedMenu === 1 ? activeMenuClass : menuClass}>Orders</p>
            </Link>
          </li>
          <li>
            <Link style={{ textDecoration: "none" }} to="/holdings" onClick={() => handleMenuClick(2)}>
              <p className={selectedMenu === 2 ? activeMenuClass : menuClass}>Holdings</p>
            </Link>
          </li>
          <li>
            <Link style={{ textDecoration: "none" }} to="/positions" onClick={() => handleMenuClick(3)}>
              <p className={selectedMenu === 3 ? activeMenuClass : menuClass}>Positions</p>
            </Link>
          </li>
          <li>
            <Link style={{ textDecoration: "none" }} to="/funds" onClick={() => handleMenuClick(4)}>
              <p className={selectedMenu === 4 ? activeMenuClass : menuClass}>Funds</p>
            </Link>
          </li>
          <li>
            <Link style={{ textDecoration: "none" }} to="/apps" onClick={() => handleMenuClick(6)}>
              <p className={selectedMenu === 6 ? activeMenuClass : menuClass}>Apps</p>
            </Link>
          </li>
        </ul>

        <hr />

        <div className="profile" onClick={handleProfileClick}>
          <div className="avatar">ZU</div>
          <p className="username">USERID</p>
        </div>

        {/* ðŸ”˜ Action Buttons */}
        <div className="sidebar-actions" style={{ marginTop: "20px", display: "flex", flexDirection: "column", gap: "10px" }}>
          <button onClick={goToFrontend} style={buttonStyle}>ðŸ”™ Back to Frontend</button>
          <button onClick={handleLogout} style={{ ...buttonStyle, backgroundColor: "#f44336" }}>ðŸšª Logout</button>
        </div>
      </div>
    </div>
  );
};

// ðŸŽ¨ Inline style (or move this to CSS file)
const buttonStyle = {
  padding: "8px 12px",
  border: "none",
  borderRadius: "6px",
  cursor: "pointer",
  fontWeight: "bold",
  backgroundColor: "#1976d2",
  color: "#fff",
  transition: "background 0.3s ease"
};

export default Menu;
